    <Layout>
      <h1>Skills Front-End</h1>
      <img className='skillFront' src={OnlySkill} alt="skills" />
      <h1>Skills Soft</h1>

      <h4>Trabajo en equipo</h4>
      <h4>Auto aprendizaje</h4>
      <h4>Trabajo Metodolía agiles</h4>
      <h4>Responsable</h4>
      <h4>Facilidad de comunicación</h4>
      <h4>Redacción y escritura creativa</h4>
      <h4>Honesta</h4>

    </Layout>
  )
}
